{"id":108497826,"iid":16,"project_id":12955687,"title":"Release new snowplow spend package","description":"I've been contacted by Doug Beatty from dbt labs regarding the open PR on out GitHub repo [here](https://github.com/gitlabhq/snowflake_spend/pull/2)

